import React from "react";
import { Outlet, Link } from 'react-router-dom';

import '../Css/Boton-Nav.css';


function BarraNav(props){
  return(
    <div className = 'contenedor'>
      <img
        className = 'imagenBarra'
        src = {props.urlLogoDeLaPag}
        alt = 'Logo barra nav' />
      <label
        className='BotonCambioPag'>
        <Link to={props.urlDeLaPag1}>{props.titulo1}</Link>
      </label>
      <label
        className='BotonCambioPag'>
        <Link to={props.urlDeLaPag2}>{props.titulo2}</Link>
      </label>
      <label
        className='BotonCambioPag'>
        <Link to={props.urlDeLaPag3}>{props.titulo3}</Link>
      </label>
      <label
        className='BotonCambioPag'>
        <Link to={props.urlDeLaPag4}>{props.titulo4}</Link>
      </label>
      <label
        className='BotonCambioPag'>
        <Link to={props.urlDeLaPag5}>{props.titulo5}</Link>
      </label>
      <Outlet />
    </div>
  );
};

export default BarraNav;
